// 基本工具

/**
 * 合并对象 obj1 <--add-- obj2
 * @param {对象1} obj 
 * @param {对象2} obj2
 */ 
 export const mergeObject = (obj, obj2) => {
    for (let key in obj2) {
        if (obj2[key] != null && obj2[key].trim() !== '') {
            obj[key] = obj2[key]
        }
    }
}

export const createId = () => {
    let date = new Date();
    let rund = Math.ceil(1000 + (Math.random()*8999))
    let id = date.getFullYear() + '' + date.getMonth() + '' + date.getDate() + '' + rund;
    return id
}
